import React from 'react'
import AppLayout from '../components/AppLayout'
import MovieInfo from '../json/movieInfo.json'


function ticketing() {
    const { store } = MovieInfo.movie

    return (
        <AppLayout>
            <div>
                <div className="movie">영화</div>
                <div className="movie-theaters" style={{ border: '1px solid red' }}>
                    <div>
                        {
                            store.map(item => (
                                <div key={item.id}>{item.지역}</div>
                            ))
                        }
                    </div>
                    <div>
                        {
                            store.map(item => (
                                <div key={item.id}>{item.매장}</div>
                            ))
                        }
                    </div>
                </div>
                <div className="time">상영시간, 날짜</div>
            </div>
        </AppLayout>
    )
}

export default ticketing
